const onClick = () => {
    const inputElement = document.getElementById("urlInput");
    if (inputElement.value === "") {
        alert("空のURLは指定できません");
    } else {
        window.location.href = `/?url=${inputElement.value}&urusai=${document.getElementById("urusai").checked}`;
    }
}
const getParam = (name, url) => {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, "\\$&");
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, " "));
}
const initFunc = () => {
    const qUrl = getParam("url", window.location.href);
    const urusai = getParam("urusai", window.location.href);
    if (qUrl !== null) {
        const qrInputElement = document.getElementById("qrInputArea");
        if (urusai == 'true') {
            document.body.style.background = "linear-gradient(white, red, blue, yellow, green, purple, black)";
            document.getElementById("title").innerHTML = "<img style='width: 300px' src='data:image/png;base64,'>";
            qrInputElement.innerHTML =
                `<a href="${qUrl}" style="color: white" target="_blank"><h2>送金先</h2>
            ${qUrl.indexOf("paypay") !== -1 ? "(PayPay)" : ""}
            </a><div id="qrcode"></div>
            <br>
            <label style="background: red;">
            ＿人人人人人人人人人人人＿<br>
            ＞　返すかわからんけど　＜<br>
            ￣^Y^Y^Y^Y^Y^Y^Y^￣
            </label>`;
        } else {
            qrInputElement.innerHTML =
                `<a href="${qUrl}" target="_blank"><h2>送金先</h2>
            ${qUrl.indexOf("paypay") !== -1 ? "(PayPay)" : ""}
            </a><div id="qrcode"></div>
            <br>
            <label>
            返すかわからんけど
            </label>`;
        }
        const qrcode = new QRCode(document.getElementById("qrcode"), {
            text: qUrl,
            width: 300,
            height: 300,
            colorDark: "#ffffff",
            colorLight: "#000000",
            correctLevel: QRCode.CorrectLevel.H
        });
    }
}

initFunc();